webpackJsonp([0xb3f457ed2874],{728:function(e,t){e.exports={data:{markdownRemark:{html:'<style>\n.content {\n  width:40%;\n}\n</style>\n<p>Program administrators can configure custom fields to add data to their reports. This enables your program members to add additional information to your reports to help you better manage and analyze your internal data by the categories that you define to be important, such as by business unit or by root cause analysis.</p>\n<div class="betanote" markdown="1">\n<b>Note:</b> This feature is currently in beta and is only available for select programs. You must be an enterprise program to opt-in to the feature. If youâ€™re an enterprise program and would like to opt-in to the feature, please contact your program manager.\n</div>\n<div class="background content" markdown="1">\n<table>\n<thead>\n<tr>\n<th>In this article, you can learn to:</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><a href="#create">Create a Custom Field</a></td>\n</tr>\n<tr>\n<td><a href="#fill">Fill in a Value for a Custom Field</a></td>\n</tr>\n<tr>\n<td><a href="#edit">Edit a Custom Field</a></td>\n</tr>\n<tr>\n<td><a href="#archive">Archive a Custom Field</a></td>\n</tr>\n</tbody>\n</table>\n</div>\n<h3 id="create">Create a Custom Field</h3>\n<blockquote>\n<p><strong>Note:</strong> You must be an administrator of the program in order to add a custom field.</p>\n</blockquote>\n<p>To create a custom field:</p>\n<ol>\n<li>Go to <strong>Program > Customization > Custom Fields</strong>.</li>\n<li>Click <strong>New Custom Field</strong>.</li>\n<li>Enter the <strong>Field Title</strong> on the <strong>Create Custom Field</strong> page.</li>\n<li>Select the <strong>Field Type</strong>. You can choose from:</li>\n</ol>\n<table>\n<thead>\n<tr>\n<th>Option</th>\n<th>Details</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Text</td>\n<td>This option enables you to create an editable text field.\n<br>\n<br>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-2-dc7b26215beb4b5ce614e9ee421ba97a-fd59d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.91677675033026%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="creating a text type custom field"\n        title=""\n        src="/static/custom-fields-2-dc7b26215beb4b5ce614e9ee421ba97a-2f183.png"\n        srcset="/static/custom-fields-2-dc7b26215beb4b5ce614e9ee421ba97a-67829.png 125w,\n/static/custom-fields-2-dc7b26215beb4b5ce614e9ee421ba97a-5c59f.png 250w,\n/static/custom-fields-2-dc7b26215beb4b5ce614e9ee421ba97a-2f183.png 500w,\n/static/custom-fields-2-dc7b26215beb4b5ce614e9ee421ba97a-c93e8.png 750w,\n/static/custom-fields-2-dc7b26215beb4b5ce614e9ee421ba97a-fd59d.png 757w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </td>\n</tr>\n<tr>\n<td>List</td>\n<td>This option enables you to create a drop-down list that you can select from when editing your custom field.\n<br>\n<br>\nEnter your option items in the \n<strong>Configuration List</strong>\n field separated by a comma.\n<br>\n<br>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-3-84e788bf4c8e6ffe8dca8f12c98fee86-4c573.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 76.58998646820028%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="creating a list type custom field"\n        title=""\n        src="/static/custom-fields-3-84e788bf4c8e6ffe8dca8f12c98fee86-2f183.png"\n        srcset="/static/custom-fields-3-84e788bf4c8e6ffe8dca8f12c98fee86-67829.png 125w,\n/static/custom-fields-3-84e788bf4c8e6ffe8dca8f12c98fee86-5c59f.png 250w,\n/static/custom-fields-3-84e788bf4c8e6ffe8dca8f12c98fee86-2f183.png 500w,\n/static/custom-fields-3-84e788bf4c8e6ffe8dca8f12c98fee86-4c573.png 739w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </td>\n</tr>\n</tbody>\n</table>\n<ol start="5">\n<li>Click <strong>Save</strong>.</li>\n</ol>\n<p>All of your reports will now have a Custom Fields section. You can edit the section to add the Custom Field label you created.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-cc9ef.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 29.50191570881226%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Custom Fields section on the report"\n        title=""\n        src="/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-2f183.png"\n        srcset="/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-67829.png 125w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-5c59f.png 250w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-2f183.png 500w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-c93e8.png 750w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-cc9ef.png 783w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The custom field will also be added into your inbox filter so that you can filter your reports by the custom field you created. (The image below shows the filter 2 custom fields that were created: Squad and Root Cause Analysis)</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-5-a7191ac0f2f324bd0b442630f62845de-80aea.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 109.7609561752988%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Custom fields inbox filter"\n        title=""\n        src="/static/custom-fields-5-a7191ac0f2f324bd0b442630f62845de-2f183.png"\n        srcset="/static/custom-fields-5-a7191ac0f2f324bd0b442630f62845de-67829.png 125w,\n/static/custom-fields-5-a7191ac0f2f324bd0b442630f62845de-5c59f.png 250w,\n/static/custom-fields-5-a7191ac0f2f324bd0b442630f62845de-2f183.png 500w,\n/static/custom-fields-5-a7191ac0f2f324bd0b442630f62845de-80aea.png 502w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="fill">Fill in a Value for a Custom Field</h3>\nTo fill in a value for a Custom Field to your report:\n1. Go the report you want to add a custom field to.\n2. Click **Edit** in the Custom Fields section.\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-cc9ef.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 29.50191570881226%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="edit button in the custom fields section"\n        title=""\n        src="/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-2f183.png"\n        srcset="/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-67829.png 125w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-5c59f.png 250w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-2f183.png 500w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-c93e8.png 750w,\n/static/custom-fields-4-2bdfcf906b0d68c96045f1ca1185edc3-cc9ef.png 783w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="3">\n<li>Enter the information you want to add to the field for each field label.</li>\n<li>Click <strong>Save and add fields</strong>.</li>\n</ol>\n<p>The information you input will now be tied to your field labels. To edit the information, click <strong>Edit</strong>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-6-abcbe0593422e2b17e49c52c031657e8-fb137.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 379px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.910290237467024%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="what custom fields looks like in the report"\n        title=""\n        src="/static/custom-fields-6-abcbe0593422e2b17e49c52c031657e8-fb137.png"\n        srcset="/static/custom-fields-6-abcbe0593422e2b17e49c52c031657e8-0edc9.png 125w,\n/static/custom-fields-6-abcbe0593422e2b17e49c52c031657e8-6340d.png 250w,\n/static/custom-fields-6-abcbe0593422e2b17e49c52c031657e8-fb137.png 379w"\n        sizes="(max-width: 379px) 100vw, 379px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>When you export your reports as a CSV file, the custom field and the information associated will also be included in the export.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-7-e56a21937df2ea97053f9a5fe41f093b-aa87e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 12.563323201621074%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAADCAYAAACTWi8uAAAACXBIWXMAAAsSAAALEgHS3X78AAAAhElEQVQI101MSRKDIBDk//+JFQWEO9sjWEQvxBd0GKwYD129zjCpVrymCatWcN7DBf/nn376Zx4CjLXgUuA9z+BCgK394cI5lNZjZJy9uA8Jvh8TjDWwzt05aQJ1148FQkqwnDOO48C+79i2DaX7WitijHh25EdfClJKtz4/J1pr44b2X0PNz8+1Qv7VAAAAAElFTkSuQmCC\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="custom fields in the exported report"\n        title=""\n        src="/static/custom-fields-7-e56a21937df2ea97053f9a5fe41f093b-2f183.png"\n        srcset="/static/custom-fields-7-e56a21937df2ea97053f9a5fe41f093b-67829.png 125w,\n/static/custom-fields-7-e56a21937df2ea97053f9a5fe41f093b-5c59f.png 250w,\n/static/custom-fields-7-e56a21937df2ea97053f9a5fe41f093b-2f183.png 500w,\n/static/custom-fields-7-e56a21937df2ea97053f9a5fe41f093b-c93e8.png 750w,\n/static/custom-fields-7-e56a21937df2ea97053f9a5fe41f093b-aa87e.png 987w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="edit">Edit a Custom Field</h3>\nYou can edit your custom fields to change the name of the field title.\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-f9b60.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 42.31311706629055%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="custom fields list"\n        title=""\n        src="/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-2f183.png"\n        srcset="/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-67829.png 125w,\n/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-5c59f.png 250w,\n/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-2f183.png 500w,\n/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-c93e8.png 750w,\n/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-4e628.png 1000w,\n/static/custom-fields-9-1956f08c813366db4ae60e1d21b7cc6f-f9b60.png 1418w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>To edit the title of a custom field:</p>\n<ol>\n<li>Go to <strong>Program > Customization > Custom Fields</strong>.</li>\n<li>Click <strong>Edit</strong> for the custom field label you want to edit.</li>\n<li>Enter the new title.</li>\n<li>(<em>Optional</em>) Change the <strong>Field Type</strong> from <em>Text</em> to <em>List</em>. You can only change the field type from <em>Text</em> to <em>List</em>. You canâ€™t change a <em>List type</em> to a <em>Text type</em>.</li>\n<li>Click <strong>Save</strong>.</li>\n</ol>\n<h3 id="archive">Archive Custom Fields</h3>\nYou can archive custom fields that you no longer want to use. We donâ€™t enable you to permanently delete custom fields to prevent data loss.\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/custom-fields-8-06c65573e4ae873effbc37fa46ecbeb6-04968.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 40.44502617801047%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="unarchive custom fields"\n        title=""\n        src="/static/custom-fields-8-06c65573e4ae873effbc37fa46ecbeb6-2f183.png"\n        srcset="/static/custom-fields-8-06c65573e4ae873effbc37fa46ecbeb6-67829.png 125w,\n/static/custom-fields-8-06c65573e4ae873effbc37fa46ecbeb6-5c59f.png 250w,\n/static/custom-fields-8-06c65573e4ae873effbc37fa46ecbeb6-2f183.png 500w,\n/static/custom-fields-8-06c65573e4ae873effbc37fa46ecbeb6-c93e8.png 750w,\n/static/custom-fields-8-06c65573e4ae873effbc37fa46ecbeb6-04968.png 764w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>To archive a custom field:</p>\n<ol>\n<li>Go to <strong>Program > Customization > Custom Fields</strong>.</li>\n<li>Click <strong>Archive</strong>.</li>\n</ol>\n<p>The archived field can no longer be added to new reports. Current and past reports with the archived field will remain on the report and wonâ€™t disappear. You can, however, edit the field within the report.  </p>\n<p>You can unarchive an archived custom field by clicking <strong>Unarchive</strong>.</p>',frontmatter:{path:"/programs/custom-fields.html",id:"programs/custom-fields",title:"Custom Fields",description:null}}},pathContext:{}}}});
